import { useNavigate } from "react-router-dom";

function FormOfNoticeWrite({ header, content }) {
  const navigate = useNavigate();

  return (
    <section>
      <header>제목: {header}</header>
      <article>
        <p>내용: {content}</p>
      </article>
      <div>
        <button
          onClick={() => {
            navigate(-1);
          }}
        >
          취소하기
        </button>
        <button>등록하기</button>
      </div>
    </section>
  );
}
export default FormOfNoticeWrite;
